import unittest
import requests
import os


class EndPoints(unittest.TestCase):
    """Test Case for endpoints"""

    def setUp(self):
        # Local
        self.url_base = "http://0.0.0.0:5005/api/" + "v2.0/"
        # Dev
        # self.url_base = "http://api-dev.clustering.czi.technology/api/v0.1/"
        # Prod
        # self.url_base = "http://api.clustering.czi.technology/api/v0.1/"
        self.session = requests.Session()

    def test_cells(self):
        url = "{base}{endpoint}?{params}".format(base=self.url_base, endpoint="cells", params="&".join(
            [ "louvain=B cells"]))
        result = self.session.get(url)
        assert result.status_code == 200
        result_data = result.json()
        assert "B cells" in result_data["data"]["ranges"]["louvain"]["options"]
        url = "{base}{endpoint}?{params}".format(base=self.url_base, endpoint="cells", params="&".join(
            ["louvain=B cells", "louvain=Megakaryocytes"]))
        result = self.session.get(url)
        assert result.status_code == 200
        result_data = result.json()
        assert "Megakaryocytes" in result_data["data"]["ranges"]["louvain"]["options"]

